import NavBar from "./NavBar";
import {
    APIProvider,
    Map,
    AdvancedMarker,
    Pin,
    InfoWindow
} from "@vis.gl/react-google-maps";

const mapContainerStyle = {
    width: "500px",
    height: "500px"
};


export default function Dashboard(){
    const position = {
        lat: 16.255168643233784,
        long: 80.32518364053286
    };
    return(
        <>
            <NavBar/>
            <div id="content">
                <h1>Live Location:</h1>

                <APIProvider apiKey="AIzaSyAqHW3QmMMYPOP6uR5MMFvQQoIB3OkdhnE">
                    <div style={mapContainerStyle}>
                        <Map zoom={13} center={position}>

                        </Map>
                    </div>
                </APIProvider>

            </div>
        </>
    )
}
